.dashboard-container {
  height: 100%;
}

.dashboard {
  &-container {
    padding: 30px;
    background-color: #f0f2f5;
  }
  &-text {
    font-size: 30px;
    line-height: 46px;
  }
}

.text {
  font-size: 14px;
}

.item {
  margin-bottom: 18px;
}

.clearfix:before,
.clearfix:after {
  display: table;
  content: "";
}
.clearfix:after {
  clear: both;
}

.box-card {
  width: 40%;
  min-width: 280px;
  display: inline-block;
  line-height: initial;
  margin-right: 20px;
}
